script: |
  super -f text -I q7640.spq | sort > q7640.out

inputs:
  - name: q7640.spq
    data: |
      SELECT DISTINCT - col1 * 4 * + col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN 23 * + + col2 * + col1 + + + col1 - + CAST ( CAST ( - col1 AS REAL ) AS INTEGER ) + + col0 / - - 92 * + 53 AND NULL;
  - name: tab2

outputs:
  - name: q7640.out
    data: |
